import React from 'react';
import {List, ListItem, ListItemText} from '@material-ui/core';
import Title from "./Title"

class HighLevelList extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            highLevelData: [],
            isLoaded: false
        }
    }
    componentDidMount(){
        fetch('http://my-json-server.typicode.com/aniquedavla/demo/highLevelData')
              .then(response => response.json())
              .then(json => this.setState({
                  highLevelData: json,
                  isLoaded: true
              }));
      }
    render(){
        if(this.state.isLoaded){
            return(
                <div>
                    <Title>At a high level</Title>
                    <List>
                        <ListItem>
                        <ListItemText primary={"Number of Communities:"+ this.state.highLevelData.numberOfCommunities} />
                        </ListItem>
                        <ListItem>
                        <ListItemText primary="Total number of listings:" />
                        </ListItem>
                        <ListItem>
                        <ListItemText primary="Total registered users:" />
                        </ListItem>
                        <ListItem>
                        <ListItemText primary="Total page views:" />
                        </ListItem>
                    </List>
                </div>
            );
        } else {
            return(
                <div>
                <Title>At a high level</Title>
                <List>loading...</List>
            </div>
            );
        }
    }
}
export default HighLevelList
